import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope } from '@fortawesome/free-solid-svg-icons'
import React from 'react'

function ContactMe() {


  const handleOnSubmit = async (event) => {
    event.preventDefault()

    // const form = event.target

    // const data = Object.fromEntries(new FormData(form))
    // console.log(data)

    // fetch('/api/sessions', {
    //   method: 'POST',
    //   headers: { 'Content-Type': 'application/json' },
    //   body: JSON.stringify(data)
    // })
    //   .then(res => res.json())
    //   .then(res => {
    //     if (res.error) {
    //       setError(res.error)
    //     } else {
    //       setError(null)
    //       setLoggedInUser(res)
    //       navigate('/dashboard')
    //     }
    //   })
  }

  const handleClickSubmit = (e) => {
      e.preventDefault()
  }

  return (
    <div className="container form">
      <div className="row">
        <div className="col-md-6 offset-md-3">
          <div className="card">
            <div className="card-body">
            <h5 className="card-title">Get in Touch</h5>
            <h5 className="card-title">I will respond asap if a valid email is provided! </h5>
              <h2 className="card-title">Contact Me</h2>
               <div className="contact__options">
                <h5><FontAwesomeIcon icon={ faEnvelope } /> madie86@gmail.com</h5>
               </div>
              <form onSubmit={handleOnSubmit}>
                <div className="mb-3">
                  <label 
                  htmlFor="email" 
                  className="form-label"></label>
                  <input 
                    type="fullname" 
                    name="fullname" 
                    className="form-control" 
                    id="fullname" 
                    placeholder="Your Full Name"
                    required />
                </div>
                <div className="mb-3">
                  <label 
                  htmlFor="email" className="form-label"></label>
                  <input 
                      type="email"
                      className="form-control" 
                      id="email" 
                      name='email' 
                      placeholder="Your Email"
                      required />
                </div>
                <div className="mb-3">
                  <textarea 
                    type="message"
                    className="form-control" 
                    id="message" 
                    name='message' 
                    placeholder="Your message"
                    />
                </div>
                <button 
                  className='btn btn-primary'
                  type='submit' 
                  onClick={handleClickSubmit}>
                    Submit   
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default ContactMe;
